import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './Pages';

function App() {
  return (
    <Router>
      <div className="app">
        <header>
          {/* Include your site header or navigation component here */}
        </header>
        <main>
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
          </Switch>
        </main>
        <footer>
          {/* Include your site footer component here */}
        </footer>
      </div>
    </Router>
  );
}

export default App;
